import React from 'react';
import axios from 'axios';
import './App.js'

class TodoList extends React.Component {

    onDelete(event) {
        event.preventDefault();

        axios.delete('http://localhost:4000/todo/:TodoID', {
            name: this.refs.name.value,
            todoItem: this.refs.todoItem.value,
        })

        .then((response) => {
            console.log(response);
        })

        .catch((error) => {
            console.log(error);
        });
    }

    render() {
        return(
            <div> 
                <ul className="collection with-header">
                    <li className="collection-header"><h5>Todos</h5></li>
                    {props.todos.map((item) => (
                        <div className="collection-item" key={item._id}>Name: {item.name} <br/> Todo: {item.todoItem} <br/> Date: {item.date} <br/> 
                        <button className="btn-floating material-icons">grade</button>
                        <button className="btn-floating material-icons">create</button>
                        <button className="btn-floating material-icons">delete</button>
                        </div>
                    ))}
                </ul>
            </div>
        );
    }
}


export default TodoList;
